@gabrielmedina it was amazing to be there to witness you win your third title!! Congrats brother! You had an incredible season and even though the format wasn’t your favorite, you showed your dominance this year and sealed the deal yesterday. It’s been awesome to see you and @yasminbrunet1 enjoy this year together and how your happiness and lightness has taken your surfing and performances to even higher levels. It’s scary for the rest of us 😂🙌🏾🙌🏾 
@wsl 
